import { Avatar } from "@mui/material";
import { format } from "date-fns";
import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getAllTKB } from "../../../redux/actions/adminActions";

const axios = require("axios");

const Body = () => {
  const API = axios.create({ baseURL: "http://localhost:9090/" });
  API.interceptors.request.use((req) => {
    if (localStorage.getItem("user")) {
      req.headers.Authorization = `Bearer ${
        JSON.parse(localStorage.getItem("user")).retObj.jwt
      }`;
    }
    return req;
  });
  const apiUrl = "/api/admin/giangVien/tkb";

  API.get(apiUrl, {
    params: {
      timeInputBegin: "2023-03-30",
      timeInputEnd: "2023-04-30",
    },
  })
    .then((response) => {
      console.log(response.data);
    })
    .catch((error) => {
      console.error(error);
    });

  // const dispatch = useDispatch();
  // useEffect(() => {
  //   dispatch(getAllTKB(requestData));
  // }, [dispatch]);

  // const tkbs = useSelector((state) => state.teacher.tkb);
  // console.log("tkbs", tkbs);

  return <div className="items-center justify-center"></div>;
};

export default Body;
